$_MODULE['<{psaffiliate}prestashop>vouchers_87c54f7b3a75e20d72f78c754e56f0af'] = 'În această zonă puteți selecta un număr de voucher care va fi folosit ca șabloane.';
$_MODULE['<{psaffiliate}prestashop>vouchers_9d309cffbfcc1f37507e6aa747cd0de9'] = 'Afiliații vor putea să genereze coduri de vouchere pe baza șabloanelor selectate.';
$_MODULE['<{psaffiliate}prestashop>vouchers_f67dcbe1d448921fc81fe382db040432'] = 'Sfaturi:';
$_MODULE['<{psaffiliate}prestashop>vouchers_5ca344684899d6591e6c6dfd55db8a0b'] = '1. Introduceți toate detaliile referitoare la condițiile de reducere (ex .: categoriile care se vor aplica, cantitatea minimă, restricțiile de produs pentru țara / transportatorul / grupul de clienți / compatibilitate / produs sau dacă sunt disponibile numai pentru un anumit produs) în zona \"descriere\" Regula de coș. Aceste informații vor fi afișate numai companiilor afiliate.';
$_MODULE['<{psaffiliate}prestashop>vouchers_8c5f81ba1faf060085429bb13421b88a'] = '2. Numele șablonului afișat în partea din față va fi numele regulii Cart, dar afiliații vor putea să introducă un alt nume atunci când generează cupoane.';
$_MODULE['<{psaffiliate}prestashop>vouchers_b4dce6ce233354ba7a8e86e815d1ff65'] = '3. Codul va fi, de asemenea, generat de afiliații dvs., dar va fi prefixat cu codul pe care îl introduceți. De exemplu, dacă codul Regulilor de coș este \"AFFBEAUTY\" și un afiliat creează un voucher cu codul \"FACEBOOKAD\", codul final va fi \"AFFBEAUTY_FACEBOOKAD\". Dacă lăsați câmpul \"Cod\" gol, atunci codul final nu va fi prefixat.';
$_MODULE['<{psaffiliate}prestashop>vouchers_00bb943966006e3fa93cda8e7f8ddbe9'] = '4. \"Valabil de la\" și \"Valabil la\" din Voucherele create de afiliații dvs. vor fi exact aceleași cu cele pe care le introduceți atunci când creați regula coșului.';
$_MODULE['<{psaffiliate}prestashop>vouchers_2d47a58e552ae35bb2f5ca314b1a330e'] = '5. Ștergerea șabloanelor Regulilor de coș sau dezactivarea acestora din zona \"Reguli de coș\" va afecta Voucherele existente create de afiliații dvs. Dacă ștergeți un șablon de reguli pentru carduri sau dacă îl dezactivați, toate voucherele create din șablon vor fi șterse sau dezactivate. Același lucru este dacă re-activați regula coșului. ATENȚIE: Înlăturarea unui șablon de reguli pentru carduri din această zonă nu va afecta voucherele existente create de afiliații dvs., dacă nu le dezactivați din secțiunea \"Reguli de coș\".';
$_MODULE['<{psaffiliate}prestashop>vouchers_dd0c357ee26e3e0f161bec4af1e3075f'] = 'Activați urmărirea voucherelor';
$_MODULE['<{psaffiliate}prestashop>vouchers_93cba07454f06a4a960172bbd6e2a435'] = 'Da';
$_MODULE['<{psaffiliate}prestashop>vouchers_bafd7322c6e97d25b6299b5d6fe8920b'] = 'Nu';
$_MODULE['<{psaffiliate}prestashop>vouchers_305fd964caa3872a8e8fba4f749fb599'] = 'Activarea acestui lucru va permite urmărirea vizitatorilor prin codul de voucher pe care l-au folosit. De exemplu, dacă fac o achiziție utilizând un voucher furnizat de unul dintre afiliații dvs., achiziția lor va fi asociată afiliatului respectiv. De asemenea, funcționează cu afiliere pe viață.';
